import React, {Component} from 'react';
import './events.css';

class Events extends Component{
    render(){
        return(
            <section className="events-container">
                <h1>EVENTS CALENDER</h1>
                <iframe src="https://calendar.google.com/calendar/embed?src=vjtf0dm3iu1j47lcf7r3m55prk%40group.calendar.google.com&ctz=America%2FLos_Angeles" style="border: 0" width="800" height="600" frameborder="0" scrolling="no"></iframe>
            </section>
        );
    }
}

export default Events;
